# Definition for a binary tree node.
from typing import List, Optional

class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right

class Solution:
    def buildTree(self, inorder: List[int], postorder: List[int]) -> Optional[TreeNode]:
        # Map of value -> index in inorder to optimize lookup
        inorder_index_map = {val: idx for idx, val in enumerate(inorder)}

        # We use a helper function that takes the range of inorder and postorder
        def build(in_left, in_right):
            if in_left > in_right:
                return None

            # The last item in postorder is the root
            root_val = postorder.pop()
            root = TreeNode(root_val)

            # Root splits inorder list into left and right subtrees
            index = inorder_index_map[root_val]

            # Build right subtree first because postorder is L-R-Root
            root.right = build(index + 1, in_right)
            root.left = build(in_left, index - 1)

            return root

        return build(0, len(inorder) - 1)
